class Monster:
    def __init__(self, name, xp, hp, ac, image=None):
        self.name = name
        self.xp = xp
        self.hp = hp
        self.ac = ac
        if image is None:
            self.image = "https://www.dndbeyond.com/avatars/thumbnails/6/359/420/618/636272697874197438.png"
        else:
            self.image = image

    def __str__ (self):
        return f'Name: {self.name}\nCategory: {self.xp} \nCost: {self.hp} \nDamage: {self.ac}'





